import React, { Component } from 'react';
import Modal from 'react-awesome-modal';

export default class UploadReportPopUp extends Component {
    constructor(props) {
        super(props);
        this.state = {
            visible : false
        }
        this.id = props.id;
    }
   

    openModal() {      
        this.setState({
            visible : true,
        });
    }

    closeModal() {
        this.setState({
            visible : false,
        });
    }

    render() {
        return (
            <section >
                <input type="button"  value="Upload report" style={{float: "right", marginLeft:"10px"}} className="btn btn-bg btn-info"  onClick={() => this.openModal()} />
                <div>
                    <Modal visible={this.state.visible} width="650" height="800" effect="fadeInUp" onClickAway={() => this.closeModal()}>
                        
                    </Modal>
                </div>
            </section>
        );
    }
}
